        public cJournalReader()
        {
            ElitePath = Path.Combine(Environment.GetFolderPath(Environment.SpecialFolder.UserProfile), "Saved Games\\Frontier Developments\\Elite Dangerous\\");
            JournalFilter = "Journal.*T*.log";
        }

